import { useState, useEffect } from "react";
import Layout from "../components/layout/layout";

function Cart() {
  const [cart, setCart] = useState([]);

  useEffect(() => {
    setCart(JSON.parse(sessionStorage.getItem("cart")));
  }, []);

  return (
    <Layout>
      <div className={position.container}>
        <h1>Test</h1>
      </div>
    </Layout>
  );
}

export default Cart;
